import React from "react";
import { Jumbotron } from "react-bootstrap";

const Error = () => {
  return <>
     <Jumbotron>
       <h2>Error Page not Found</h2>
       <small>Errorcode 404</small>
     </Jumbotron>
  </>;
};

export default Error;
